import { combineReducers, configureStore } from "@reduxjs/toolkit";
import { toDoRerducer } from "./ToDoReducer";
import { checkboxReducer } from "./CheckboxReducer";

export const store = configureStore({
  todos: toDoRerducer,
  checkbox: checkboxReducer,
});
